import React from 'react'

const ListImages = ({ images }) => {

    const ItemImage = images.map((image) => {
        return (
            <div className=" card" key={image.id}>
                <img src={image.image} className="card-img" alt="..." />
            </div>
        )
    })


    return (
        <div className=" mb-3">
            {ItemImage}
        </div>
    )
}

export default ListImages
